import React from 'react';
import userService from './userService';

class UserComponent extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            users:[]
        }
    }

    componentDidMount(){
        userService().then((response)=>{
             this.setStatestate = response.data;
        })
    }

    render(){
        
        return (
            <div>
                <p>Hello</p>
            </div>
        )
    }
}

export default UserComponent;
